import React from 'react'

export default function Activity() {
  return (
    <div>
        <div><strong>Activity</strong>:{' '} </div>
        <div><strong>Difficulty</strong>:{' '} </div>
        <div><strong>Season</strong>:{' '} </div>
        <div><strong>Duration</strong>:{' '} </div>
    </div>
  )
}
